	Sleep(10);
	WriteProcessMemory(hProc, (LPVOID)(moveBase + 0x5), &deactive, sizeof(char), 0);


	bool breakFlag = false;
	DWORD isAttack = 0, attackBase;
	INPUT KEY_B;
	KEY_B.type = INPUT_KEYBOARD;
	KEY_B.ki.time = 0;
	KEY_B.ki.wVk = 0;
	KEY_B.ki.dwExtraInfo = 0;
