bool attachProc() {
	hwnd = FindWindowA(NULL, procName);
	if (hwnd) {
		GetWindowThreadProcessId(hwnd, &pID);

		if (pID != NULL) {

			hProc = OpenProcess(PROCESS_VM_READ | PROCESS_VM_OPERATION | PROCESS_VM_WRITE, FALSE, pID);
			if (hProc == NULL) {
				std::cout << "cant handle" << std::endl;
			}
			else {

				return true;

			}
		}
		else std::cout << "cant find ID" << std::endl;

	}

	else
		std::cout << "cant find window" << std::endl;

	return false;
}
